import React from "react";
import ImgMediaCard from "./card";
import Grid from "@material-ui/core/Grid";

const Content = () => {
  const [rockets, setRockets] = React.useState(null);
  React.useEffect(() => {
    fetch("https://api.spacexdata.com/v3/launches?limit=10")
      .then((res) => res.json())
      .then((res) => {
        console.log("res", res);
        setRockets(res);
      });
  }, []);
  return (
    <Grid container >
      {rockets &&
        rockets.map((rocket) => (
            <Grid item xs={12} sm={12} md={6} sm={5} lg ={6}>
          <ImgMediaCard
            title={rocket.rocket.rocket_name}
            image={rocket.links.mission_patch_small}
          />
          </Grid>
        ))}
    </Grid>
  );
};

export default Content;
